/**
 * Multipage
 */
const multipage={storeData:t=>{const a=JSON.stringify(t),e=btoa(a);sessionStorage.setItem("form_data",e)},getData:()=>{const t=sessionStorage.getItem("form_data");if(null==t)return{};const a=atob(t),e=JSON.parse(a);return e},deleteAllData:()=>{sessionStorage.removeItem("form_data")},addModifyItemToData:(t,a)=>{const e=multipage.getData();e[t]=a,multipage.storeData(e)},getItemInData:t=>{const a=multipage.getData();return a[t]}};